#include <gtest/gtest.h>
#include <vector>
#include <string>

#include "Hackerrank/sherlock_string.h"

TEST(Hackerrank, sherlock_string_Test) {
  std::string s0 = "aabbcd";
  std::string s1 = "aabbccddeefghi";
  std::string s2 = "abcdefghhgfedecba";
  std::string s3 = "";
  std::string s4 = "abbccc";

  EXPECT_FALSE(Hackerrank::isValid(s0));
  EXPECT_FALSE(Hackerrank::isValid(s1));
  EXPECT_TRUE(Hackerrank::isValid(s2));
  EXPECT_TRUE(Hackerrank::isValid(s3));
  EXPECT_FALSE(Hackerrank::isValid(s4));
}